Крымское туристическое агентство "TURION-TRAVEL"
Выгодные предложения и акции в отелях Крыма - будь в курсе! 
Сеть крымских турагентств "Турион" - отдых в Крыму по честным ценам.
   Предоставляемые услуги:
    подбор санаториев в соответствии с диагнозом;
    санаторно-курортная реабилитации и лечение за границей (путевки, курсовки);
    консультации по вопросам диагностики и лечения за границей и на Украине;
    индивидуальный подбор клиники;
    (второе мнение) организация консультаций ведущих специалистов с мировым именем;
    диагностики и консультаций в любой стране мира;
    лечения за рубежом (конфиденциальное), пластические операции (анонимно);
    представление Ваших интересов в иностранных клиниках;
    сопровождение и проверка договоров и документов.
